import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';
import './Carousel_response.css';
class Carousel_response extends Component {
    render() {
        return (
            <Carousel
                axis='vertical'
                verticalSwipe='standard'
                emulateTouch={true}
                infiniteLoop={true}
                showArrows={true}
                showStatus={false}
            >
                <div>
                    <img src="https://images.pexels.com/photos/373076/pexels-photo-373076.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940" />
                    <div className="middle_area" >
                        <div className="left_area" >
                            haoyang li
                        </div>
                        <div className="right_area">
                            <p>cv</p>
                            <p>discription</p>
                        </div>
                    </div>
                    <p className="legend">Legend 1</p>
                </div>
                <div>
                    <img src="https://images.pexels.com/photos/356056/pexels-photo-356056.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940" />
                    <p className="legend">Legend 2</p>
                </div>
                <div>
                    <img src="https://images.pexels.com/photos/825258/pexels-photo-825258.jpeg?auto=compress&cs=tinysrgb&h=650&w=940" />
                    <p className="legend">Legend 3</p>
                </div>
            </Carousel>
        );
    }
}
export default Carousel_response;
